import React from 'react';
import GetTask from './GetTask.jsx';
import newArr from './DisplayMonths.jsx';

function Tasks(){

    function insertTask(){
        newArr.splice(150, 0 , "New Task");
    }

    return(
        <div>
        <div className = "tasksContainer">
            <GetTask />
        </div>
        <button onClick = {insertTask} className = "addTaskBtn">Add Task</button>
        </div>
    );
}

export default Tasks;
